import React from 'react';
import logo from './logo.svg';
import './App.css';

const bucketListData = [
  {
    title:"Bucket 1",
    bucketId:"123",
    data:[{
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    }
    ]

  },
  {
    title:"Bucket 2",
    bucketId:"123",
    data:[{
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    },
    {
      taskId:"123",
      taskName:"Go to Park"
    }
    ]
  }
]

const todoList = (data) => {
  return (
    data.map(item=>{
        <tr>
          <td>{item.name}</td>
        </tr>
    })
  )
}

function App() {
  return (
    <div className="App">
      {bucketListData.map((item)=>{
        <div>
          <th>
            {item.title}
          </th>
            {todoList(item.data)}
        </div>

      })}
    </div>
  );
}

export default App;
